import React from "react";
import "./navigation.css";

class Addpost extends React.Component {
  render() {
    return (
      <div className="nav">
        <ul>
          <li>Home</li>
          <li>Posts</li>
          <li>NewPost</li>
        </ul>
      </div>
    );
  }
}

export default Addpost;
